import { Route, Routes } from "react-router-dom";
import Checkout from "./Routes/Checkout/Checkout";

const Router = () => {
    return (
        <Routes>
            <Route path="/" element={<Checkout/>}/>
        </Routes>
    );
};

export default Router;
